function ReceivedCard({Greeting, Body, Closing, GreetingImage}) {
    return (
        <div id="RecievedCard">
            <div className="img-wrap">
				<img src={GreetingImage} alt="" />
			</div>
            <div className="received-message">
                <div className="message-inner">
                    <p className="text">{Greeting}</p>
                    <p className="text">{Body}</p>
                    <p className="text">{Closing}</p>
                </div>
            </div>

            <div className="btn-wrap">
                <button>Like this card? Send one to someone.</button>
            </div>
        </div>
    );
}

export default ReceivedCard;
